import { Planets, useState } from "./planets";
export function Head() {
  const [toggler, setToggler] = useState("inline-block");

  function toggle() {
    if (toggler === "inline-block") {
      setToggler("none");
    } else if (toggler === "none") {
      setToggler("inline-block");
    }
  }
  return (
    <header className="d-flex flex-column">
      <div className="header-small d-flex justify-content-between align-items-center ">
        <h3>THE PLANETS</h3>
        <svg
          xmlns="http://www.w3.org/2000/svg"
          width="24"
          height="17"
          style={{ cursor: "pointer" }}
          onClick={toggle}
        >
          <g fill-rule="evenodd">
            <path d="M0 0h24v3H0zM0 7h24v3H0zM0 14h24v3H0z"></path>
          </g>
        </svg>
      </div>
      <Planets toggler={toggler} />
    </header>
  );
}
